import React from 'react'
import { Link } from 'react-router-dom'
import VerifiedIcon from '@mui/icons-material/Verified';
import classes from './Card.module.css'
const Card = ({imageurl , title , description , channelName , id , channel}) => {
    let imgClass;
    if(channel){
        imgClass = 'channel'

    }
    
    return (
        <div className={classes.card}  >
            <Link to={`/vidio/:${id}`}>
                <img src={imageurl} alt={title} className={classes.imgClass} />
            </Link>
            
            <div className={classes['card-text']}>
                <p>{description}</p>
                <Link to={`/channel/${id}`}> 
                {channelName} 
                <VerifiedIcon />
                </Link>
            </div>
        </div>
    )
}

export default Card
